-- Structure for view `v_order_action_summary`
--
DROP TABLE IF EXISTS `v_order_action_summary`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_order_action_summary`  AS SELECT `order_actions_log`.`order_id` AS `order_id`, count(0) AS `total_actions`, min(`order_actions_log`.`created_at`) AS `first_action_at`, max(`order_actions_log`.`created_at`) AS `last_action_at`, sum(case when `order_actions_log`.`action_type` = 'put_on_hold' then 1 else 0 end) AS `times_on_hold`, sum(case when `order_actions_log`.`action_type` = 'stock_checked' then 1 else 0 end) AS `times_stock_checked` FROM `order_actions_log` GROUP BY `order_actions_log`.`order_id` ;

