CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_order_last_action`  AS SELECT `o`.`id` AS `order_id`, `o`.`order_number` AS `order_number`, `o`.`status` AS `status`, `oal`.`action_type` AS `last_action`, `oal`.`created_at` AS `last_action_at`, `oal`.`performed_by` AS `last_action_by`, `u`.`name` AS `last_action_by_name` FROM ((`orders` `o` left join `order_actions_log` `oal` on(`oal`.`id` = (select `order_actions_log`.`id` from `order_actions_log` where `order_actions_log`.`order_id` = `o`.`id` order by `order_actions_log`.`created_at` desc limit 1))) left join `users` `u` on(`u`.`id` = `oal`.`performed_by`)) ;

